Body mass index (BMI) is a measure of body fat based on height and weight that applies to adult men and women. Commonly accepted BMI ranges are underweight: under 18.5 kg/m<sup>2</sup>, normal weight: 18.5 to 25, overweight: 25 to 30, obese: over 30.

*Example: 165cm/63kg, 175cm/98kg or 180cm/84kg.

